package baidu_gosdk

import (
	"github.com/1cool/baidu-gosdk/imagerecognition"
	"testing"
)

func TestNewBaiduBce(t *testing.T) {
	type args struct {
		clientID     string
		clientSecret string
	}
	tests := []struct {
		name    string
		args    args
		want    BaiduBce
		wantErr bool
	}{
		{
			name:    "access token error",
			wantErr: true,
			args: args{
				clientID:     "1",
				clientSecret: "2",
			},
		},
		{
			name:    "success",
			wantErr: false,
			args: args{
				clientID:     "2URrSYIv586qlCC5YpDn9ByT",
				clientSecret: "lEhkGLLzfXvLHqECH0Oqt4keTyv9oKRK",
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			_, err := NewBaiduBce(tt.args.clientID, tt.args.clientSecret)
			if (err != nil) != tt.wantErr {
				t.Errorf("NewBaiduBce() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
		})
	}
}

func Test_baiduBce_NewImageRecognition_Dish(t *testing.T) {
	type args struct {
		clientID     string
		clientSecret string
		req          imagerecognition.DishRequest
	}
	tests := []struct {
		name    string
		args    args
		wantErr bool
	}{
		{
			name: "success",
			args: args{
				clientID:     "",
				clientSecret: "",
				req: imagerecognition.DishRequest{
					Image: "",
				},
			},
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			b, err := NewBaiduBce(tt.args.clientID, tt.args.clientSecret)
			if (err != nil) != tt.wantErr {
				t.Errorf("NewBaiduBce() error = %v, wantErr %v", err, tt.wantErr)
				return
			}

			r, err := b.NewImageRecognition().Dish(tt.args.req)
			if (err != nil) != tt.wantErr {
				t.Errorf("NewImageRecognition().Dish() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			t.Log(r)
		})
	}
}
